import React from 'react';

import { Container, Text, Button, ButtonIcon, Image } from './styles';

const Index: React.FC = () => {
  return (
    <Container>
      <Text>Encontre dados do Covid-19 em Sergipe</Text>
      <Image>
        <ImageBackground />
      </Image>

      <Button>
        Ver Dados
        <ButtonIcon />
      </Button>
    </Container>
  );
};

export default Index;
